import{_ as t,a as e}from"./chunks/rtk_cuav_c-rtk_to_6pin_connector.CPckekK7.js";import{_ as a,c as r,o,ab as d}from"./chunks/framework.CUflZczI.js";const k=JSON.parse('{"title":"CUAV C-RTK","description":"","frontmatter":{},"headers":[],"relativePath":"zh/gps_compass/rtk_gps_cuav_c-rtk.md","filePath":"zh/gps_compass/rtk_gps_cuav_c-rtk.md"}'),i={name:"zh/gps_compass/rtk_gps_cuav_c-rtk.md"},s=d('<h1 id="cuav-c-rtk" tabindex="-1">CUAV C-RTK <a class="header-anchor" href="#cuav-c-rtk" aria-label="Permalink to &quot;CUAV C-RTK&quot;">​</a></h1><p>The <a href="https://www.cuav.net/en/c_rtk_9ps/" target="_blank" rel="noreferrer">CUAV C-RTK GPS receiver</a> is an <a href="./../gps_compass/rtk_gps.html">RTK GPS module</a> for the mass market. 一个完整的RTK 系统由至少两个 c-rtk 模块 组成(一个用于基站, 另外一个作为移动站用于飞机上)。 使用RTK，PX4控制器可以获取到它的位置，并且这个位置的精度可以达到厘米级的精度，这比普通GPS提供的位置更加精确。</p><img src="'+t+'" width="500px" title="C-RTK"><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><ul><li><a href="https://item.taobao.com/item.htm?id=565380634341&amp;spm=2014.21600712.0.0" target="_blank" rel="noreferrer">cuav淘宝店铺</a></li><li>[cuav aliexpress](<a href="https://www.aliexpress.com/store/product/CUAV-NEW-Flight-Controller-GPS-C-RTK-differential-positioning-navigation-module-GPS-for-PIX4-Pixhawk-pixhack/3257035_32853894248.html?spm=2114.12010608.0.0.75592fadQKPPEn" target="_blank" rel="noreferrer">https://www.aliexpress.com/store/product/CUAV-NEW-Flight-Controller-GPS-C-RTK-differential-positioning-navigation-module-GPS-for-PIX4-Pixhawk-pixhack/3257035_32853894248.html?spm=2114.12010608.0.0.75592fadQKPPEn</a></li></ul><p>Context)</p><h2 id="配置" tabindex="-1">配置 <a class="header-anchor" href="#配置" aria-label="Permalink to &quot;配置&quot;">​</a></h2><p>RTK setup and use on PX4 via <em>QGroundControl</em> is largely plug and play (see <a href="./../gps_compass/rtk_gps.html">RTK GPS</a> for more information).</p><h2 id="接线和连接" tabindex="-1">接线和连接 <a class="header-anchor" href="#接线和连接" aria-label="Permalink to &quot;接线和连接&quot;">​</a></h2><p>C-RTK GPS comes with a cable that terminates in a 6-pin connector and 4-pin connector that are compatible with <a href="https://doc.cuav.net/flight-controller/pixhack/en/quick-start-pixhack-v3x.html#gps--compass" target="_blank" rel="noreferrer">Pixhack v3</a>. 6针连接器提供 rtk gps 的接口, 并应连接到飞行控制器的 gps 接口。 4针连接器是一个 m8n (标准) gps 接口, 可作为第二个 gps(可选)。</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>At time of writing PX4 does not yet fully support a second GPS. The 4-pin port need not be connected.</p></div><img src="'+e+'" width="500px" title="C-RTK_6PIN"><p>The cables/connectors may need to be modified in order to connect to other flight controller boards. The pin mappings for <em>Pixhawk 3 Pro</em> and <em>Pixracer</em> are shown below.</p><h3 id="针脚定义" tabindex="-1">针脚定义 <a class="header-anchor" href="#针脚定义" aria-label="Permalink to &quot;针脚定义&quot;">​</a></h3><p>The C-RTK GPS pinout is provided below. This can be used to help modify the connector for other autopilot boards.</p><table><thead><tr><th>引脚</th><th>C-RTK GPS 6P</th><th>引脚</th><th>Pixhawk 3 Pro GPS</th><th>C-RTK GPS 4P</th></tr></thead><tbody><tr><td>1</td><td>SDA</td><td>1</td><td>VCC</td><td></td></tr><tr><td>2</td><td>SCL</td><td>2</td><td>GPS_TX</td><td></td></tr><tr><td>3</td><td>GPS_RX</td><td>3</td><td>GPS_RX</td><td>GPS_RX</td></tr><tr><td>4</td><td>GPS_TX</td><td>4</td><td>SCL</td><td>GPS_TX</td></tr><tr><td>5</td><td>VCC_5V</td><td>5</td><td>SDA</td><td>VCC_5V</td></tr><tr><td>6</td><td>GND</td><td>6</td><td>GND</td><td>GND</td></tr></tbody></table>',16),n=[s];function h(c,p,l,_,m,P){return o(),r("div",null,n)}const g=a(i,[["render",h]]);export{k as __pageData,g as default};
